import React, { Component } from "react";
import CentersTable from "./centersTable";
import { getCenters } from "../fakeCenters";
import Pagination from "./common/pagination";
class Centers extends Component {
  state = {
    centers: [
      { name: "Stadion A", location: "Zrenjanin" },
      { name: "Stadion B", location: "Beograd" },
      { name: "Stadion C", location: "Novi Sad" },
    ],
    currentPage: 1,
    pageSize: 4,
  };

  render() {
    const { centers } = this.state;
    return (
      <ol>
        {centers.map((center) => (
          <li key={center.name}>{center.name}</li>
        ))}
      </ol>
    );
  }
}

export default Centers;
